import React, { Component } from 'react';
import { Link } from 'react-router-dom';
import '../App.css';
import axios from 'axios';

class showSongDetails extends Component {
  constructor(props) {
    super(props);
    this.state = {
      song: {}
    };
  }

  componentDidMount() {
    // console.log("Print id: " + this.props.match.params.id);
    axios.get('http://localhost:8082/api/songs/'+this.props.match.params.id)
      .then(res => {
        // console.log("Print-showSongDetails-API-response: " + res.data);
        this.setState({
          song: res.data
        })
      })
      .catch(err => {
        console.log("Error from ShowSongDetails");
      })
  };

  onDeleteClick (id) {
    axios
      .delete('http://localhost:8082/api/songs/'+id)
      .then(res => {
        this.props.history.push("/");
      })
      .catch(err => {
        console.log("Error form ShowSongDetails_deleteClick");
      })
  };


  render() {

    const song = this.state.song;
    let SongItem = <div>
      <table className="table table-hover table-dark">
        {/* <thead>
          <tr>
            <th scope="col">#</th>
            <th scope="col">First</th>
            <th scope="col">Last</th>
            <th scope="col">Handle</th>
          </tr>
        </thead> */}
        <tbody>
          <tr>
            <th scope="row">1</th>
            <td>Title</td>
            <td>{ song.title }</td>
          </tr>
          <tr>
            <th scope="row">2</th>
            <td>Author</td>
            <td>{ song.author }</td>
          </tr>
          <tr>
            <th scope="row">3</th>
            <td>ISBN</td>
            <td>{ song.isbn }</td>
          </tr>
          <tr>
            <th scope="row">4</th>
            <td>Publisher</td>
            <td>{ song.publisher }</td>
          </tr>
          <tr>
            <th scope="row">5</th>
            <td>Published Date</td>
            <td>{ song.published_date }</td>
          </tr>
          <tr>
            <th scope="row">6</th>
            <td>Description</td>
            <td>{ song.description }</td>
          </tr>
        </tbody>
      </table>
    </div>

    return (
      <div className="ShowSongDetails">
        <div className="container">
          <div className="row">
            <div className="col-md-10 m-auto">
              <br /> <br />
              <Link to="/" className="btn btn-outline-warning float-left">
                  Show Song List
              </Link>
            </div>
            <br />
            <div className="col-md-8 m-auto">
              <h1 className="display-4 text-center">Song's Record</h1>
              <p className="lead text-center">
                  View Song's Info
              </p>
              <hr /> <br />
            </div>
          </div>
          <div>
            { SongItem }
          </div>

          <div className="row">
            <div className="col-md-6">
              <button type="button" className="btn btn-outline-danger btn-lg btn-block" onClick={this.onDeleteClick.bind(this,song._id)}>Delete Song</button><br />
            </div>

            <div className="col-md-6">
              <Link to={`/edit-song/${song._id}`} className="btn btn-outline-info btn-lg btn-block">
                    Edit Song
              </Link>
              <br />
            </div>

          </div>
            {/* <br />
            <button type="button" class="btn btn-outline-info btn-lg btn-block">Edit Song</button>
            <button type="button" class="btn btn-outline-danger btn-lg btn-block">Delete Song</button> */}

        </div>
      </div>
    );
  }
}

export default showSongDetails;
